import React from "react";
import { Button } from "../../UI/Button/Button";
import { Input } from "../../UI/Input/Input";
import classes from './Form.module.scss'


function Form (props) {

    console.log(props);



    return (


        <div className={classes.form}>

            <form>
                {

                    props.a.map((i) => (

                        <Input key={i.id} onChange={i.onChange} type={i.type} id={i.id} ph={i.ph} lable={i.label} value={i.value} />

                        )
                    )

                }


                <div className={classes.btnLine}>
                <Button />
                </div>
            </form>

        </div>


    )

}


export default Form
